import React from 'react';
import { useWebRTC } from '../hooks/WebRTCClient'; // Adjust the path if necessary

const VideoCallComponent = () => {
  const { initiateCall, answerCall } = useWebRTC();

  return (
    <div>
      <button onClick={() => initiateCall('receiverId')}>Start Call</button>
      <button onClick={answerCall}>Answer Call</button>
      {/* Video elements go here */}
    </div>
  );
};

export default VideoCallComponent;
